comment: |-
  SELECT T2.Make,
         T1.Year
  FROM CARS_DATA AS T1
  JOIN CAR_NAMES AS T2 ON T1.Id = T2.MakeId
  WHERE T1.Year =
      (SELECT min(YEAR)
       FROM CARS_DATA);

sql: |-
  SELECT T2.Make,
         T1.Year
